import React from 'react'
import "./header.css"
function Header () {
    return (
        <div className="jumbotron">
            <h1>React Google Book Search</h1>
            <h3>Search for and Save Books of Interest</h3>
            <img src="./images/book-search-image.jpg" alt="Book-Search" />
        </div>
    )
}

export default Header
